import React from 'react'
// Styles:
import Styles from "../styles/components/Navbar.module.css"

const Navbar:React.FC = () => {
    return (
        <div className={Styles["Navbar"]}>
            <h1>WizardManager</h1>
            <h2>Current Page</h2>

        </div>
    )
}

export default Navbar
